import './style.css';
import Post from './Post';
import Get from './Get';
import { useState } from 'react';
function App() {
  const [data, setData] = useState([]);

  function GetData() {
    fetch('http://localhost:9000/ApiYoutube')
      .then((res) => res.json())
      .then((data) => {
        setData(data);
      });
  }
  useEffect(() => {
    GetData();
  }, []);
  return (
    <div className='Flex'>
      <Get />
      <Post />
    </div>
  );
}

export default App;
